import React from 'react'

const ReviewCard = (props) => {

    const {id , info , name , picture , rating} = props.review;
    console.log(picture);

    return(
        <div className = {`grid grid-in-review${props.id} bg-yellow-600`}>
            <div className = "flex flex-col text-center justify-evenly">
                <div className = "flex justify-center w-full h-1/5">
                    <img src = {`${picture}`} className = "rounded-full"/>
                </div>
                <h1>{name}</h1>
                <h1>{info}</h1>
                <h1>{rating}</h1>
            </div>
        </div>
    );
}

export default ReviewCard;
